      const CURRENT_DATE = new Date();
      const date = ref<Date | Date[] | undefined>(new Date());
      const startDate = new Date(CURRENT_DATE.getFullYear(), CURRENT_DATE.getMonth(), CURRENT_DATE.getDate() - 4);
